column8:
車の周囲にレーダーゾーンを２重に張れるセンサーです。<br>外側と内側のゾーン検知信号をそれぞれ別に出力します。<br>誤作動を低減するために、外側のゾーンが検知するまでは内側のゾーンを張りません。検知距離は最大で約３.０ｍです。<br>※プライバシーガラス・防磁/熱反射ガラス、ウインドフィルム装着部分では、車外へゾーンを張れない場合があります。<br>※非金属製ルーフ車へは取付不可※複数使用不可※センサーで必ずしもすべての犯罪が防げるわけではありません。※マルチプレックスとは感知した強弱を識別し警告・警報を別々のパルス信号で出力する機能です。<br>※センサーは使用する場所における様々な環境ノイズによって失報する場合があります。近所迷惑にならないよう必要以上に感度を上げすぎず、使用環境に合わせた適度な感度設定でご利用下さい。<br>※ショックセンサー、超音波センサー、レーダーセンサーを組み合わせて使用する場合、電波干渉により誤作動する可能性があります。説明書をよくお読みの上、設置に十分ご注意ください。<br><br>※ご購入前に必ずメーカーホームページ、お問い合わせでの適合確認をお願い致します。<style type="text/css">
